class Navbar extends Component {
    state={
        isOpen:false
    }

    handleToggle=()=>{
        this.setState({isOpen:!this.state.isOpen});
    }
    render() {
        return (
            <nav className="navbar">
               <div className="nav-center">
                   <div className=""></div>
               </div>
            </nav>
